$function getImgList(){     
var p = /num-pages\">(\d*)</;     
var p1 = "(https:\/\/i.nhentai.net\/galleries\/.*\/)1.(jpg|png)";
var jpg = html.match(p)[1];     
var mp = html.match(p1);
var piclist = new Array(jpg); 
for (var i = 0; i < jpg; i++) {         
piclist[i] = mp[1] + (i+1)+"."+mp[2];
}     
return piclist; 
}
